export default function Text({ size, children, cls }) {
  switch(size){
    case "sm" : 
        return <SmallText cls={cls}>{children}</SmallText>;
    case "lg" :
        return <MidText cls={cls}>{children}</MidText>
  };
}

function SmallText({ children, cls }) {
  return <div className={`text-[13px] h-fit ${cls}`}>{children}</div>;
}

function BigText({ children, cls }){
    return <div className={`text-[20px] h-fit ${cls}`}>{children}</div>;
}

function MidText({ children, cls }){
    return <div className={`text-[16px] h-fit ${cls}`}>{children}</div>;
}
